{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/gabvader/cyclistic-data-analysis?scriptVersionId=160388615\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"69a09805","metadata":{"papermill":{"duration":0.019858,"end_time":"2024-01-25T13:24:19.405397","exception":false,"start_time":"2024-01-25T13:24:19.385539","status":"completed"},"tags":[]},"source":["### **Welcome to Cyclistic Data Analysis!** \n","This Notebook describes the steps I have taken along my way to complete the Google Analytics Capstone Project. It has been a tough but nevertheless rewarding process, with plenty of challenges and opportunities to apply, consolidate and delve into the new skills of data analysis I have been introduced into during the course. I hope you have fun while checking on this Notebook, and now, let's dive straight into the Cyclistic Data Anaysis!\n","\n","## Background\n","**Cyclistic** is a **bike-share program** that features more than 5,800 bicycles and 600 docking stations in **Chicago**. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can‚Äôt use a standard two-wheeled bike. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n","\n","Until now, Cyclistic‚Äôs marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as **casual riders**. Customers who purchase annual memberships are **Cyclistic members**.\n","\n","Cyclistic's finance analyst concluded that **members are much more profitable than casual riders**. Maximizing the number of annual members will be key to future growth, and there might be a very good chance to **convert casual riders into members**. \n","\n","In order to design marketing strategies aimed at converting casual riders into annual members, we need to better **understand how members and casual riders** differ. That is the aim ouf our study, to answer the question: \n","**How do annual members and casual riders use Cyclistic bikes differently?**\n","Let's go for it and start our analysis!\n","\n","## Table of Contents üìñ\n","* [Set up Notebook üìò](#chapter1)\n","* [Import Data üóÉÔ∏è](#chapter2)\n","* [Exploring and Understanding Data üîé](#chapter3)\n","* [Get the Data Together! ‚Äì Wrangling and Combining Datasets üîÑ](#chapter4)\n","    * [Custom function for reading monthly tables in yearly list](#subsection4_1)\n","    * [Creating a dataset for years 2021 ‚Äì 2023](#subsection4_2)\n","* [Cleaning and Sorting Data üßπ](#chapter5)\n","    * [Dropping NA values?](#subsection5_1)\n","    * [Checking Usertype Data](#subsection5_2)\n","    * [Setting and Sorting Time](#subsection5_3)\n","    * [Checking for Duplicates in `ride_id`](#subsection5_4)\n","* [Analyzing our Data üìäüìâüìà](#chapter6)\n","    * [1. Member / Casual Riders Usage](#subsection6_1)\n","    * [2. Comparative Analysis on Ride Duration](#subsection6_2)\n","    * [3. Comparative Analysis by Yearly Months](#subsection6_3)\n","    * [4. Comparative Analysis by Weekday](#subsection6_4)\n","    * [5. Comparative Analysis by Daily Hours](#subsection6_5)\n","    * [6. Comparative Analysis by Rideable Type](#subsection6_6)\n","    * [7. Most Used Stations](#subsection6_7)"]},{"cell_type":"markdown","id":"c49131cf","metadata":{"papermill":{"duration":0.018264,"end_time":"2024-01-25T13:24:19.442549","exception":false,"start_time":"2024-01-25T13:24:19.424285","status":"completed"},"tags":[]},"source":["# **Set up Notebook** üìò <a class=\"anchor\"  id=\"chapter1\"></a>\n","In this step, we lay the foundation for our exploration of the Cyclistic data within the R ecosystem.\n","\n","We will prepare our Jupyter Notebook environment by importing the necessary libraries that will empower us throughout this analysis. Specifically, bring in the indispensable tools for data manipulation and visualization, such as the tidyverse and lubridate libraries.\n","\n","Let's initiate our *coding environment*, equipping ourselves for the work that lies ahead."]},{"cell_type":"code","execution_count":1,"id":"ebdb77bb","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:24:19.483785Z","iopub.status.busy":"2024-01-25T13:24:19.481284Z","iopub.status.idle":"2024-01-25T13:24:20.70794Z","shell.execute_reply":"2024-01-25T13:24:20.70595Z"},"papermill":{"duration":1.249862,"end_time":"2024-01-25T13:24:20.710672","exception":false,"start_time":"2024-01-25T13:24:19.46081","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["‚îÄ‚îÄ \u001b[1mAttaching core tidyverse packages\u001b[22m ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ tidyverse 2.0.0 ‚îÄ‚îÄ\n","\u001b[32m‚úî\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m‚úî\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m‚úî\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m‚úî\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m‚úî\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.4     \u001b[32m‚úî\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m‚úî\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m‚úî\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m‚úî\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n","‚îÄ‚îÄ \u001b[1mConflicts\u001b[22m ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ tidyverse_conflicts() ‚îÄ‚îÄ\n","\u001b[31m‚úñ\u001b[39m \u001b[34mdpl