2:41   Length:190301      Length:190301     \n"," 1st Qu.:2023-01-09 07:45:42   Class :character   Class :character  \n"," Median :2023-01-14 16:44:41   Mode  :character   Mode  :character  \n"," Mean   :2023-01-15 09:25:02                                        \n"," 3rd Qu.:2023-01-21 14:37:42                                        \n"," Max.   :2023-02-04 04:27:03                                        \n","                                                                    \n"," end_station_name   end_station_id       start_lat       start_lng     \n"," Length:190301      Length:190301      Min.   :41.65   Min.   :-87.83  \n"," Class :character   Class :character   1st Qu.:41.88   1st Qu.:-87.66  \n"," Mode  :character   Mode  :character   Median :41.89   Median :-87.64  \n","                                       Mean   :41.90   Mean   :-87.65  \n","                                       3rd Qu.:41.93   3rd Qu.:-87.63  \n","                                       Max.   :42.07   Max.   :-87.53  \n","                                                                       \n","    end_lat         end_lng       member_casual     \n"," Min.   :41.65   Min.   :-87.84   Length:190301     \n"," 1st Qu.:41.88   1st Qu.:-87.66   Class :character  \n"," Median :41.89   Median :-87.64   Mode  :character  \n"," Mean   :41.90   Mean   :-87.65                     \n"," 3rd Qu.:41.93   3rd Qu.:-87.63                     \n"," Max.   :42.08   Max.   :-87.53                     \n"," NA's   :127     NA's   :127                        "]},"metadata":{},"output_type":"display_data"}],"source":["summary(df_2023_01)"]},{"cell_type":"markdown","id":"d7880432","metadata":{"papermill":{"duration":0.019486,"end_time":"2024-01-25T13:24:22.419814","exception":false,"start_time":"2024-01-25T13:24:22.400328","status":"completed"},"tags":[]},"source":["We have just got an accurate picture of our data. We know the **names of the columns** and what information they encode, and also the **class** of each attribute. Through the `summary()`function we also got a relevant piece of information for the cleaning process: the data for the *end_lat* and *end_lng* columns **contain NA values**."]},{"cell_type":"markdown","id":"9d3df48d","metadata":{"papermill":{"duration":0.019395,"end_time":"2024-01-25T13:24:22.458645","exception":false,"start_time":"2024-01-25T13:24:22.43925","status":"completed"},"tags":[]},"source":["# **Get the Data Together!** ‚Äì Wrangling and Combining Datasets üîÑ<a class=\"anchor\"  id=\"chapter4\"></a>\n","\n","If we take a look into our database, we can see that Cyclist have organized the data for the last years monthly. As we want to perform a broad analysis of the data, spanning more than one year (2021 ‚Äì 2023), it might get tedious to load and analyze the all monthly tables separately. To avoid that, we will combine the respective monthly datasets into **yearly tables**, clean them and lastly combine the information into one big dataframe. \n","\n","It is possible to read each table separately and then use the `rbind()` or `bind_rows()` (from the `dplyr` library) functions. However, in order to optimize the process and, most importantly, for practice sake, I created a customized function for reading the csv tables of a directory and creating a list with all the monthy tables for a given year.\n","\n","## Custom function for reading monthly tables in yearly list <a class=\"anchor\"  id=\"subsection4_1\"></a>\n","\n","The following function takes two arguments:\n","- *directory path*: path to the directory storing the monthly tables.\n","- *year*: the desired year.\n","\n","And it outputs a list with all the data frames for the given year"]},{"cell_type":"code","execution_count":6,"id":"601a9f90","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:24:22.501985Z","iopub.status.busy":"2024-01-25T13:24:22.500218Z","iopub.status.idle":"2024-01-25T13:24:22.51685Z","shell.execute_reply":"2024-01-25T13:24:22.514938Z"},"papermill":{"duration":0.041808,"end_time":"2024-01-25T13:24:22.520182","exception":false,"start_time":"2024-01-25T13:24:22.478374","status":"completed"},"tags":[]},"outputs":[],"source":["load_tables <- function(directory_path, year) {\n","  # Create empty list for storing the data frames\n","  yearly_trips_list <- list()\n","  # Loop through each month from January (1) to December (12)\n","  for (month in 1:12) {\n","    # Format the month to have leading zeros if necessary (e.g., 01, 02, ..., 12)\n","    # %d represents a decimal integer\n","    # 02% two-digit string with leading zeros \n","    month_str <- sprintf(\"%02d\", month)\n","    # File path for each month's CSV file\n","    file_path <- sprintf(\"%s/%d_%s.csv\", directory_path, year, month_str)\n","    # Check if file exists\n","    if (file.exists(file_path)) {\n","      # Generate a variable name based on the file being read\n","      var_name <- paste(\"trips_\", year, month_str, sep = \"\")\n","      # Read the CSV file and assign it to the variable name\n","      assign(var_name, read.csv(file_path))\n","      # Append the loaded data frame to the tables_list\n","      yearly_trips_list[[var_name]] <- get(var_name)\n","    }\n","  }\n","  return(yearly_trips_list)\n","}"]},{"cell_type":"markdown","id":"81387426","metadata":{"papermill":{"duration":0.019346,"end_time":"2024-01-25T13:24:22.560002","exception":false,"start_time":"2024-01-25T13:24:22.540656","status":"completed"},"tags":[]},"source":["## Creating a dataset for years 2021 ‚Äì 2023 <a class=\"anchor\"  id=\"subsection4_2\"></a>\n","Let's check out if our custom function work with the data for year 2013!"]},{"cell_type":"code","execution_count":7,"id":"16683d96","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:24:22.60532Z","iopub.status.busy":"2024-01-25T13:24:22.601409Z","iopub.status.idle":"2024-01-25T13:26:05.200637Z","shell.execute_reply":"2024-01-25T13:26:05.198672Z"},"papermill":{"duration":102.645947,"end_time":"2024-01-25T13