"," Max.   :45.64   Max.   :-73.80   Max.   :42.37   Max.   :  0.00  \n","                                  NA's   :17380   NA's   :17380   \n"," member_casual     \n"," Length:16758584   \n"," Class :character  \n"," Mode  :character  \n","                   \n","                   \n","                   \n","                   "]},"metadata":{},"output_type":"display_data"}],"source":["# Create 2021 ‚Äì 2023 dataset\n","total_trips <- bind_rows(yearlytrips_2021, yearlytrips_2022, yearlytrips_2023)\n","summary(total_trips)"]},{"cell_type":"markdown","id":"7be6cda9","metadata":{"papermill":{"duration":0.020294,"end_time":"2024-01-25T13:31:30.610964","exception":false,"start_time":"2024-01-25T13:31:30.59067","status":"completed"},"tags":[]},"source":["# **Cleaning and Sorting Data** üßπ<a class=\"anchor\"  id=\"chapter5\"></a>\n","### Dropping NA Values? <a class=\"anchor\"  id=\"subsection5_1\"></a>\n","Now that we have our data together, we could start our cleaning process by the obvious step of removing the NA's values present the `end_lat` and `end_lng` columns of our dataset. However, we should consider if this step is worthy and, more importantly, if **it might affect the integrity** of our data. Removing the rows with NA's values means deleting data for more than 17k rides so we should ask ourselves: for what kind of analysis is this cleaning step useful? Only if we want to perform an analysis of rides routes or ending stations location. We have a limited time so I won't go so deep for now. However, let's keep this information in mind so that we can proceed with the removal of NA values if needed. We will run a further chunck of code to precisely identify if we have any other NA values"]},{"cell_type":"code","execution_count":11,"id":"d4071711","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:31:30.655469Z","iopub.status.busy":"2024-01-25T13:31:30.653781Z","iopub.status.idle":"2024-01-25T13:31:54.155858Z","shell.execute_reply":"2024-01-25T13:31: