     ride_id      rideable_type         started_at           ended_at \n","                 0                  0                  0                  0 \n","start_station_name   start_station_id   end_station_name     end_station_id \n","                 0                  0                  0                  0 \n","         start_lat          start_lng            end_lat            end_lng \n","                 0                  0              17380              17380 \n","     member_casual \n","                 0 "]},"metadata":{},"output_type":"display_data"}],"source":["colSums(is.na(total_trips))"]},{"cell_type":"markdown","id":"06c00170","metadata":{"papermill":{"duration":0.020547,"end_time":"2024-01-25T13:31:54.20154","exception":false,"start_time":"2024-01-25T13:31:54.180993","status":"completed"},"tags":[]},"source":["As we can see, we have a high number of NA values for the information regarding the stations used. Following the previous argumentation, we will proceed to the cleaning of these data at the moment of focusing at this type of data.\n","\n","### Checking Usertype Data <a class=\"anchor\"  id=\"subsection5_2\"></a>\n","Our study should focus on the difference of behaviour between casual riders and members. So, first of all, let's check if the terminology for user types is consistent through our data. Just for programming practice, I have created a custom function that automatises the process of searching for invalid user types (other than *member* or *casual*"]},{"cell_type":"code","execution_count":12,"id":"4e73a4b8","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:31:54.246697Z","iopub.status.busy":"2024-01-25T13:31:54.24496Z","iopub.status.idle":"2024-01-25T13:31:54.77901Z","shell.execute_reply":"2024-01-25T13:31:54.776766Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":0.560145,"end_time":"2024-01-25T13:31:54.782186","exception":false,"start_time":"2024-01-25T13:31:54.222041","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"There are no null values\"\n","[1] \"All users are valid\"\n"]}],"source":["# Declare the function\n","check_invalid_user <- function(data){\n","  # Check for null values in 'member_casual' column\n","  null_user <- sum(is.null(data$member_casual))\n","  # Check for values different from member or casual\n","  not_valid_user <- sum(!(data$member_casual %in% c(\"member\",\"casual\" )))\n","  if (null_user > 0){\n","    print(paste(\"There are\", null_user, \"null values.\"))\n","  }\n","  else {\n","    print(\"There are no null values\")\n","  }\n","  if (not_valid_user > 0){\n","    print(paste(\"There are\", not_valid_user, \"not valid users.\"))\n","  }\n","  else {\n","    print(\"All users are valid\")\n","  }\n","}\n","\n","# Search for invalid user types\n","check_invalid_user(total_trips)"]},{"cell_type":"markdown","id":"0411ab08","metadata":{"papermill":{"duration":0.020565,"end_time":"2024-01-25T13:31:54.823434","exception":false,"start_time":"2024-01-25T13:31:54.802869","status":"completed"},"tags":[]},"source":["This means our dataset contains only the valid user types: `casual` for **casual riders** and `member` for **members**. Personally, I do not feel comfortable with the name of the `member_casual` column, it is too long. So, before moving to the next step, I will proceed to change it to `usertype`."]},{"cell_type":"code","execution_count":13,"id":"7ed881ff","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:31:54.86878Z","iopub.status.busy":"2024-01-25T13:31:54.867017Z","iopub.status.idle":"2024-01-25T13:31:54.922244Z","shell.execute_reply":"2024-01-25T13:31:54.920291Z"},"papermill":{"duration":0.081623,"end_time":"2024-01-25T13:31:54.925685","exception":false,"start_time":"2024-01-25T13:31:54.844062","status":"completed"},"tags":[]},"outputs":[],"source":["total_trips <- total_trips %>%\n","  rename(usertype = member_casual)"]},{"cell_type":"markdown","id":"f2cd8455","metadata"