80, 702, 43, 3227, 335, 400, 151, 433, 27‚Ä¶\n"]}],"source":["# Add column with calculated ride duration in seconds\n","total_trips <- total_trips %>%\n","  mutate(duration_seconds = as.numeric(difftime(ended_at, started_at, units = \"secs\")))\n","\n","glimpse(total_trips)"]},{"cell_type":"markdown","id":"c88402da","metadata":{"papermill":{"duration":0.020887,"end_time":"2024-01-25T13:32:32.689747","exception":false,"start_time":"2024-01-25T13:32:32.66886","status":"completed"},"tags":[]},"source":["#### Cleaning `duration_seconds`\n","We have to check that there are no negative values in the `duration_seconds` column. Additionally, I will consider any ride shorter than 30 seconds as unintended ride, as such short rides can not be considered as representative for the usage dynamics of Cyclistic. In order to achieve this, we will proceed firstly by declaring a function that search for negative `duration_seconds` values and run it with our `total_trips` dataset."]},{"cell_type":"code","execution_count":16,"id":"c5d4a2cc","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:32:32.735879Z","iopub.status.busy":"2024-01-25T13:32:32.734128Z","iopub.status.idle":"2024-01-25T13:32:33.104155Z","shell.execute_reply":"2024-01-25T13:32:33.101911Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":0.396594,"end_time":"2024-01-25T13:32:33.107359","exception":false,"start_time":"2024-01-25T13:32:32.710765","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"There are 509 negative values.\"\n","[1] \"There are 224240 values smaller than 30s.\"\n"]}],"source":["# Declare function for searching negative values\n","check_negative_duration <- function(data){\n","  # Checking for negative values in 'duration_sec' column\n","  negative_duration <- sum(data$duration_seconds < 0)\n","    short_duration <- sum((data$duration_seconds >= 0) & (data$duration_seconds < 30))\n","  \n","  # Check if any values are negative\n","  if (negative_duration) {\n","    print(paste(\"There are\", negative_duration, \"negative values.\"))\n","  } else {\n","    print(\"There are no negative duration values.\")\n","  }\n","  # Check if any values smaller than 30 s\n","  if (short_duration) {\n","    print(paste(\"There are\", short_duration, \"values smaller than 30s.\"))\n","  } else {\n","    print(\"There are no values smaller than 30s.\")\n","  } \n","}\n","\n","check_negative_duration(total_trips)"]},{"cell_type":"markdown","id":"b2ebe9bc","metadata":{"papermill":{"duration":0.021156,"end_time":"2024-01-25T13:32:33.150261","exception":false,"start_time":"2024-01-25T13:32:33.129105","status":"completed"},"tags":[]},"source":["The custom function `check_negative_duration()` returns the **negative values (509)** and the number of **rides shorter than 30s (224,240)**. Specially remarkable is the big ammount of rides under 30s. This might be an insight leading to further investigation, since it is not reasonable that so many customers are using Cyclist for such short rides. But we should focus on answering the key question of our study, e.g. ‚ÄúIn what ways do members and casual riders use Divvy bikes differently?‚Äù. So let's proceed by **cleaning the data of rides having negative or <30s duration**."]},{"cell_type":"code","execution_count":17,"id":"0cd3d7d8","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:32:33.196214Z","iopub.status.busy":"2024-01-25T13:32:33.194465Z","iopub.status.idle":"2024-01-25T13:32:40.862174Z","shell.execute_reply":"2024-01-25T13:32:40.859385Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":7.694727,"end_time":"2024-01-25T13:32:40.865948","exception":false,"start_time":"2024-01-25T13:32:33.171221","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"There are no negative duration values.\"\n","[1] \"There are no values smaller than 30s.\"\n"]}],"source":["# Remove negative or under 30s rides data and create a new dataset\n","total_trips_v1 <- total_trips %>% \n","  filter(duration_seconds >= 30)\n","# Check cleaning step\n","check_negative_duration(total_trips_v1)"]},{"cell_type":"markdown","id":"41b722fc","metadata":{"papermill":{"duration":0.021207,"end_time":"2024-01-25T13:32:40.909374","exception":false,"start_time":"2024-01-25T13:32:40.888167","status":"completed"},"tags":[]},"source":["#### Creating columns for Year, Month, Weekday and Hour\n","Later on, in our analysis step of data, we want to have the information on ride dates and hour handy. We can access to this information by `lubridate` package functions that get the desired elements of a date-time object such as the data of our `started_at` and `ended_at` columns, for instance the `year()` function. However, just for simplify further steps, we will **add new columns** to our dataset with the year, month, weekday and hour of each ride. "]},{"cell_type":"code","execution_count":18,"id":"2d7d352c","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:32:40.956087Z","iopub.status.busy":"2024-01-25T13:32:40.95425Z","iopub.status.idle":"2024-01-25T13:33:59.646572Z","shell.execute_reply":"2024-01-25T13:33:59.64345Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":78.748618,"end_time":"2024-01-25T13:33:59.679126","exception":false,"start_time":"2024-01-25T13:32:40.930508","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["   ride_id          rideable_type        started_at                 \n"," Length:16533835    Length:16533835    Min.   :2021-01-01 00:02:05  \n"," Class :character   Class :character   1st Qu.:2021-09-23 17:32:06  \n"," Mode  :character   Mode  :character   Median :2022-07-19 19:20:48  \n","                                       Mean   :2022-07-17 02:10:47  \n","                                       3rd Qu.:2023-05-14 14:14:44  \n","                                       Max.   :2023-11-30 23:59:14  \n","                                                          