},{"cell_type":"markdown","id":"b1d3e21e","metadata":{"papermill":{"duration":0.02707,"end_time":"2024-01-25T13:41:52.559202","exception":false,"start_time":"2024-01-25T13:41:52.532132","status":"completed"},"tags":[]},"source":["# **Analyzing our Data** üìäüìâüìà<a class=\"anchor\"  id=\"chapter6\"></a>\n","Now that we have finishing gathering, preparing, wrangling and cleaning our dataset, we can start gaining insights about our data through the **Analysis phase**. We will go through different steps that will address the **usage differences between casual riders and members**, by comparative analysis including: \n","1. Current **Proportion of Member / Casual Riders rides** and Evolution from Year 2021 to 2023.\n","2. **Rides Duration**.\n","3. Usage by **Yearly Months**.\n","4. Usage by **Weekday**.\n","4. Usage by **Daily Hours**.\n","5. Usage by **Rideable Type**.\n","6. Most used **Stations**.\n","7. Rides Distribution by **Chicago Neighborhoods**.\n","\n","## 1. Member / Casual Riders Usage <a class=\"anchor\"  id=\"subsection6_1\"></a>\n","Given the rides of year 2023, we are going to calculate the proportion of rides by members and casual riders in this year. Then, we will analyze the evolution of this distribution through the years 2021 ‚Äì 2023. \n","We are going to start visualizing results, so we will load the `ggplot2` library."]},{"cell_type":"code","execution_count":21,"id":"806094b3","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:41:52.607898Z","iopub.status.busy":"2024-01-25T13:41:52.606098Z","iopub.status.idle":"2024-01-25T13:42:03.888998Z","shell.execute_reply":"2024-01-25T13:42:03.886004Z"},"papermill":{"duration":11.311729,"end_time":"2024-01-25T13:42:03.892902","exception":false,"start_time":"2024-01-25T13:41:52.581173","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'usertype'. You can override using the\n","`.groups` argument.