ation (1822.15s) vs members (788s)\n","# Mean trip duration by user type\n","aggregate(total_trips_v2$duration_seconds ~ total_trips_v2$usertype, FUN = median)\n","# CONCLUSION: the most often duration for casual riders is 833s, longer than members (546s)\n","\n","# Max ride duration by user type\n","aggregate(total_trips_v2$duration_seconds ~ total_trips_v2$usertype, FUN = max)\n","# Min ride duration by user type\n","aggregate(total_trips_v2$duration_seconds ~ total_trips_v2$usertype, FUN = min)"]},{"cell_type":"markdown","id":"327e2ce2","metadata":{"papermill":{"duration":0.026232,"end_time":"2024-01-25T13:43:46.36366","exception":false,"start_time":"2024-01-25T13:43:46.337428","status":"completed"},"tags":[]},"source":["#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n","- Casual riders trips last in average longer (1822s, 30 min approx)  than trips by members (788s,13 min approx). Approx 2x longer.\n","- The most often register durations are 833s for casual riders (around 14 min) and 546s for members (around 10 min).\n","\n","## 3. Comparative Usage by Yearly **Months** <a class=\"anchor\"  id=\"subsection6_3\"></a>\n","Now we will focus on comparing the number of rides by user type through the months of the year. This way, we can delineate the behaviour of both user types through the year. We can also introduce the `duration_seconds` variable to check how the duration of the rides varies along different months. We will also create visualizations to help us interpret the results."]},{"cell_type":"code","execution_count":23,"id":"20bbcc43","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:43:46.417124Z","iopub.status.busy":"2024-01-25T13:43:46.415362Z","iopub.status.idle":"2024-01-25T13:43:48.940751Z","shell.execute_reply":"2024-01-25T13:43:48.938521Z"},"papermill":{"duration":2.554855,"end_time":"2024-01-25T13:43:48.943434","exception":false,"start_time":"2024-01-25T13:43:46.388579","status":"completed"},"tags":[]},"outputs":[{"name":"stderr"