83oEQZ7dSm22kt3u15FH3gprGv9uo4Yv+/0XZ7\n2t/71vcZ+mvZtrN92OoASIA9CFBUOdKvTJ89e0Cbrg5jmfmdK/g6DvJK+WjXqubW9XXLhRoM\n5ioNnrC1eumHz3N5SAoAuMapWEAIIVR73Cerv45s88SDoVlv4NUse+qpMiWqpQbfPezDdaMe\nLe/rOMin2ItnTl+MDy1fNfK2h3gXvqL4iwAgM4odAACAJDgVCwAAIAmKHQAAgCQodgAAAJKg\n2AEAAEiCYgcAACAJih0AAIAkKHYAAACSoNgBAABIgmIHAAAgCYodAACAJCh2AAAAkqDYAQAA\nSIJiBwAAIAmKHQAAgCQodgAAAJKg2AEAAEiCYgcAACAJih0AAIAkKHYAAACSoNgBAABIgmIH\nAAAgCYodAACAJCh2AAAAkqDYAQAASIJiBwAAIAmKHQAAgCQodgAAAJKg2AEAAEiCYgcAACAJ\nih0AAIAkKHYAAACSoNgBAABI4v8BeJTqWgieC6wAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Create a subset table\n","user_month <- total_trips_v2 %>% \n","  group_by(usertype, month) %>%\n","  summarise(number_of_rides = n(),\n","            average_duration = mean(duration_seconds),\n","            max_duration = max(duration_seconds)) %>% \n","  arrange(month)\n","\n","# Number of Rides per Usertype by Month\n","user_month %>%\n","  ggplot(aes(x = month(month, label = TRUE, abbr = TRUE), y = number_of_rides, fill = usertype)) +\n","  geom_col(position = \"dodge\") + \n","  labs(title = \"Number of Rides per Usertype by Month\",\n","        x = \"\",\n","        y = \"Number of Rides\",\n","        fill = \"Usertype\",\n","        subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") + \n","  theme_minimal() +\n","  theme(\n","    axis.text = element_text(size = 10, color = \"black\"),\n","    axis.title = element_text(size = 12, color = \"black\"),\n","    legend.title = element_text(size = 12, color = \"black\"),\n","    legend.text = element_text(size = 10, color = \"black\"),\n","    plot.title = element_text(size = 14, color = \"black\")\n","  )\n","# CONCLUSION: casual max rides month: JUL -- member max rides month: AUG\n","user_month %>% \n","  arrange(desc(number_of_rides))\n","# CONCLUSION: casual 3 max rides months: JUL,AUG,JUN -- member 3 max rides months: AUG,JUL,SEP\n","\n","# Rides Duration per Usertype by Month\n","user_month %>%\n","  ggplot(aes(x = month(month, label = TRUE, abbr = TRUE), y = average_duration, fill = usertype)) +\n","  geom_col(position = \"dodge\") + \n","    \n","  labs(title = \"Average Trip Duration per Usertype by Month\",\n","        x = \"\",\n","        y = \" Trip Duration (s)\",\n","        fill = \"Usertype\",\n","        subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") + \n","  theme_minimal() +\n","  theme(\n","    axis.text = element_text(size = 10, color = \"black\"),\n","    axis.title = element_text(size = 12, color = \"black\"),\n","    legend.title = element_text(size = 12, color = \"black\"),\n","    legend.text = element_text(size = 10, color = \"black\"),\n","    plot.title = element_text(size = 14, color = \"black\")\n","  )\n","# TOP 3 Months (Average Duration Rides) Casual Riders\n","top3months_casual <- user_month %>%\n","  filter(usertype==\"casual\") %>% \n","  mutate(month = month(month, label = TRUE, abbr = TRUE)) %>% \n","  arrange(desc(average_duration)) %>%\n","  slice_head(n=3)\n","top3months_casual\n","# TOP 3 Months (Average Duration Rides) Member\n","top3months_member <- user_month %>%\n","  filter(usertype==\"member\") %>% \n","  mutate(month = month(month, label = TRUE, abbr = TRUE)) %>% \n","  arrange(desc(average_duration)) %>%\n","  slice_head(n=3)\n","top3months_casual\n","# CONCLUSION: casual max avg duration: JUN -- member max avg duration: JUN\n","# CONCLUSION: casual 3max avg duration: JUN, MAY, APR -- member 3max avg duration: JUN, JUL, AUG\n"]},{"cell_type":"markdown","id":"547c8205","metadata":{"papermill":{"duration":0.027819,"end_time":"2024-01-25T13:43:48.998991","exception":false,"start_time":"2024-01-25T13:43:48.971172","status":"completed"},"tags":[]},"source":["#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n","- Casual riders trips last in average longer (1822s, 30 min approx)  than trips by members (788s,13 min approx). Approx 2x longer.\n","- The most often register durations are 833s for casual riders (around 14 min) and 546s for members (around 10 min).\n","\n","## 4. Comparative Usage by **Weekday** <a class=\"anchor\"  id=\"subsection6_4\"></a>\n","Let's analyze now how casual riders and members use Cyclistic services depending on the weekday. This way, we could infer if they ride our bikes during leisure time or if they use the service for communiting (although further studies will be necessary to confirm this assumptions)."]},{"cell_type":"code","execution_count":24,"id":"14dcc8f5","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:43:49.059919Z","iopub.status.busy":"2024-01-25T13:43:49.057428Z","iopub.status.idle":"2024-01-25T13:43:51.997012Z","shell.execute_reply":"2024-01-25T13:43:51.993855Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":2.97421,"end_time":"2024-01-25T13:43:52.000898","exception":false,"start_time":"2024-01-25T13:43:49.026688","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'usertype'. You can override using the\n","`.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeYDM9R/H8fd3zp29LyyLdZP7jqiQRJJ0OEpRkQ4KFT9HRTp0SMmRkhyVbimU\nUnJEQoRC7vtee19zfH9/jF2zh9lZ5lhfz8df5vv5Hu/P5zuz8/K9RlFVVQAAAHDl0wW6AAAA\nAHgHwQ4AAEAjCHYAAAAaQbADAADQCIIdAACARhDsAAAANIJgBwAAoBEEOwAAAI0g2HlN+vFp\niqIoitLq+bUXm+ej2jGKonRadthvVc2oGa0oytiDKX7b4qWxZx988aGbE8pFmIIjVyRnX2y2\nIfFhSlH0puAy8TVvuefRz9cccZ1/99wbFEWp8+Dv7reecfJDRVHC4od4pzOlW7BepyjKy4dT\nLzbDPWVCFEW5bf1Jf1ZVmvn0Q3Rs5Z3O9/DalJwCTQ7b2SijXlGUSjctKrzgzpltFEXRG8LO\nWB3eLWlZ+4qX/Aa4qj5KQOlEsPO+Da92+e5UZqCruMIsvq/DCx8tP5Ya1qx5I4tOcT+zzmgO\nyk+xZZ05tuenr2b2uaHqQx9s9U/N8K6Z06dPmzYt0FX4W2yT4c5/TN2VVKApZf/EJJtDRE5t\neKnwDwRtnrVXREIrDIk18mccwAX8RfA+hy1lQJeXAl3FFWbqr8dEZNqOHetWrWwVZnI/8/Xz\n/8nMz2bP3L1haa+6Uapqm/tE+81pVuec0Q0fGD