\n","  summarise(number_of_rides = n(),\n","            average_duration = mean(duration_seconds),\n","            max_duration = max(duration_seconds)) %>% \n","  arrange(weekday)\n","\n","# Number of Rides per Usertype by Weekday\n","user_weekday %>%\n","  ggplot(aes(x = weekday, y = number_of_rides, fill = usertype)) +\n","  geom_col(position = \"dodge\") + \n","  labs(title = \"Number of Rides per Usertype by Weekday\",\n","       x = \"\",\n","       y = \"Number of Rides\",\n","       fill = \"Usertype\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n","  theme_minimal() +\n","  theme(\n","    axis.text = element_text(size = 10, color = \"black\"),\n","    axis.title = element_text(size = 12, color = \"black\"),\n","    legend.title = element_text(size = 12, color = \"black\"),\n","    legend.text = element_text(size = 10, color = \"black\"),\n","    plot.title = element_text(size = 14, color = \"black\")\n","  )\n","# CONCLUSION: casual riders usage at weekends, members at weekdays\n","\n","# Rides Duration per Usertype by Weekday\n","user_weekday %>%\n","  ggplot(aes(x = weekday, y = average_duration, fill = usertype)) +\n","  geom_col(position = \"dodge\") + \n","  labs(title = \"Average Trip Duration per Usertype by Weekday\",\n","       x = \"\",\n","       y = \" Trip Duration (s)\",\n","       fill = \"Usertype\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n","  theme_minimal() +\n","  theme(\n","    axis.text = element_text(size = 10, color = \"black\"),\n","    axis.title = element_text(size = 12, color = \"black\"),\n","    legend.title = element_text(size = 12, color = \"black\"),\n","    legend.text = element_text(size = 10, color = \"black\"),\n","    plot.title = element_text(size = 14, color = \"black\")\n","  )\n","# CONCLUSION: Average duration of casual riders increases at weekends, members stable"]},{"cell_type":"markdown","id":"fb950392","metadata":{"papermill":{"duration":0.029503,"end_time":"2024-01-25T13:43:52.060336","exception":false,"start_time":"2024-01-25T13:43:52.030833","status":"completed"},"tags":[]},"source":["I am also interested in representing the **differential behaviour** between casual riders and members through **weekdays (Mon ‚Äì Fri)** and **weekends (Sat ‚Äì Sun)**. In order to do that, I will represent the number of trips taken place within these two time periods.\n","> <div class=\"alert alert-block alert-warning\">\n","    Please note that <b>weekdays span more days (5) than weekend days (2)</b>. This means that the sum of rides on weekdays will overrepresent this data in comparasion with the sum of rides on weekend days. In order to avoid that, we will perform a <b>normalization</b> of the respective sums by the number of days of each period of days (sum  / 5 or sum / 2) </div>"]},{"cell_type":"code","execution_count":25,"id":"3dc17f93","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:43:52.123676Z","iopub.status.busy":"2024-01-25T13:43:52.121697Z","iopub.status.idle":"2024-01-25T13:43:59.631339Z","shell.execute_reply":"2024-01-25T13:43:59.629347Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":7.544713,"end_time":"2024-01-25T13:43:59.634559","exception":false,"start_time":"2024-01-25T13:43:52.089846","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'usertype'. You can override using the\n","`.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT9f/H8fdlp3tCoZS99xYE2SIbXOwl4AZkKMpQQUTx60ARUBSRpThQnLhQ\nhoAoIFMB2Xu0UEr3SO73R6CkK0nbtIX7PR9/NZ9b7/t8cpdXk9xFUVVVAAAAcOvTlXQBAAAA\n8A6CHQAAgEYQ7AAAADSCYAcAAKARBDsAAACNINgBAABoBMEOAABAIwh2AAAAGkGw85rEc/MV\nRVEUpcVzW/Ka58MaoYqidP7pVLFV9U61EEVRpp24