9W1qeXd4cLIU6lGixP9ywb26hqKQ83beHgci93H3nwWlpu92P5Vuy0/Zvfb9cowMfd\nzdOvbnj37fffu+RhR+lW1DO4yXYzAGdSzGazzfADIIQQyfGXsnyDfLV8egEAUHARdgAAAJLg\n8gMAAIAkCDsAAABJEHYAAACSIOwAAAAkQdgBAABIgrADAACQBGEHAAAgCcIOAABAEoQdAACA\nJAg7AAAASRB2AAAAkiDsAAAAJEHYAQAASIKwAwAAkARhBwAAIAnCDgAAQBKEHQAAgCQIOwAA\nAEkQdgAAAJIg7AAAACRB2AEAAEiCsAMAAJAEYQcAACAJwg4AAEAShB0AAIAkCDsAAABJEHYA\nAACSIOwAAAAkQdgBAABIgrADAACQBGEHAAAgCcIOAABAEoQdAACAJAg7AAAASRB2AAAAkvh/\n0lsjkMddIMwAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Subset of data\n","user_weekend <- total_trips_v2 %>%\n","  mutate(day_category = ifelse(weekday %in% c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\"), \"Weekday\", \"Weekend\")) %>%\n","  group_by(usertype, day_category) %>% # Group by user and day category\n","  summarise(number_of_rides = n(),\n","            average_duration = mean(duration_seconds)) %>% \n","  mutate(total_days = ifelse(day_category == \"Weekday\", 5, 2), # Define total days based on day category\n","         normalized_rides = number_of_rides / total_days) # Perform normalisation\n","# Viz of data\n","user_weekend %>%\n","  ggplot(aes(x = usertype, y = normalized_rides, fill = day_category)) +\n","  geom_bar(stat= \"identity\", position = \"dodge\") + \n","  labs(title = \"Number of Rides per Usertype by Week Period\",\n","       x = \"\",\n","       y = \"Number of Rides\",\n","       fill = \"Week Period\",\n","       subtitle = \"January 2021 - November 2023 / Normalized per days on period\") +\n","  scale_fill_brewer(palette = \"Set3\") +  # Using a different color palette\n","  theme_minimal() +\n","  theme(\n","    axis.text = element_text(size = 10, color = \"black\"),\n","    axis.title = element_text(size = 12, color = \"black\"),\n","    legend.title = element_text(size = 12, color = \"black\"),\n","    legend.text = element_text(size = 10, color = \"black\"),\n","    plot.title = element_text(size = 14, color = \"black\")\n","  )"]},{"cell_type":"markdown","id":"018a6203","metadata":{"papermill":{"duration":0.030724,"end_time":"2024-01-25T13:43:59.696497","exception":false,"start_time":"2024-01-25T13:43:59.665773","status":"completed"},"tags":[]},"source":["#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n","- Member usage is slightly higher on weekdays (Mon ‚Äì Fri) than at weekends, impliying possible commuting purposes. The average ride duration remains stable through every day of the week.\n","- Casual riders usage is increased at weekends, implying usage of Cyclistic on leisure time. The average ride duration increases at weekends.\n","\n","## 5. Comparative Usage by **Daily Hours** <a class=\"anchor\"  id=\"subsection6_5\"></a>\n","The next questions that arise concern the distribution of members and casual riders trips through the day. Are there any peak / rush hours? Do casual riders and members like to use Cyclistic in different period of the day? In order to answer this, we would look at the average number of rides per hour, which will depict an average day on Cyclistic's life. As we have already seen some differences between members and casual riders usages by weekday / weekend, we will also make the respective calculations and visualisations for the respective weekly periods."]},{"cell_type":"code","execution_count":26,"id":"8ecef271","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:43:59.763221Z","iopub.status.busy":"2024-01-25T13:43:59.761301Z","iopub.status.idle":"2024-01-25T13:44:26.791221Z","shell.execute_reply":"2024-01-25T13:44:26.788204Z"},"jupyter":{"source_hidden":true},"papermill":{"duration":27.068021,"end_time":"2024-01-25T13:44:26.795096","exception":false,"start_time":"2024-01-25T13:43:59.727075","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'usertype', 'hour'. You can override using\n","the `.groups` argument.\n","\u001b[1m\u001b[22m`summarise(