day_category) %>% # Group by user type and hour\n","  summarise(number_of_rides = n(),\n","            average_duration = mean(duration_seconds),\n","            max_duration = max(duration_seconds)) %>%\n","  group_by(usertype, hour, day_category) %>% \n","  summarise(average_rides_per_hour = mean(number_of_rides)) %>% \n","  group_by(usertype, hour, day_category) %>% \n","  summarise(average_rides_per_hour_per_user = mean(average_rides_per_hour))\n","\n","# Calculate peak hours\n","peak_hours <- user_hour %>%\n","  group_by(usertype, day_category) %>% \n","  arrange(desc(average_rides_per_hour_per_user)) %>% \n","  slice_head(n=1)\n","peak_hours\n","#CONCLUSIONS: casual riders peak hour: 15(weekends) --- 17(weekdays)\n","            # member riders peak hour: 17(weekdays) --- 15(weekends)\n","\n","# Visualize average rides per hour per user type\n","user_hour %>%\n","  ggplot(aes(x = hour, y = average_rides_per_hour_per_user, color = usertype)) +\n","  geom_line() + \n","  labs(title = \"Number of Rides per Usertype by Hour\",\n","       x = \"Hours\",\n","       y = \"\",\n","       color = \"Usertype\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_color_brewer(palette = \"Set2\", direction = 1) +  # Using a different color palette\n","  theme_minimal() +\n","  facet_wrap(~ day_category, scales = \"free_x\")\n","\n","# Duration of Rides per Usertype by Hour\n","user_hour_duration %>%\n","  ggplot(aes(x = hour, y = average_duration, fill = usertype)) +\n","  geom_area(position = \"stack\") + \n","  labs(title = \"Average Ride Duration per Usertype by Hour\",\n","       x = \"Hour of Day\",\n","       y = \"Seconds\",\n","       fill = \"Usertype\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n","  theme_minimal() +\n","  facet_wrap(~ day_category)\n"]},{"cell_type":"markdown","id":"a2c8ca94","metadata":{"papermill":{"duration":0.034427,"end_time":"2024-01-25T13:44:26.864704","exception":false,"start_time":"2024-01-25T13:44:26.830277","status":"completed"},"tags":[]},"source":["#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n","- Member rides have two peaks under the week: between 8 - 7 hrs. and at around 17 hrs. This reinforces the hypothesis that member usage is related to commuting purposes. \n","- Casual rides have only one peak under the week, at 17 hrs, this means after the usual working hours. Again, we have an insight of usage for leisure purposes. \n","- At weekends, both members and casual rides have a more normal distribution of rides through the day with an increase at mid-day - afternoon.\n","- Of note, rides duration of casual rides increases after midnight. This might be dued to usage as an alternative to public transportation when this service is closed late at night.\n","\n","## 6. Comparative Usage by **Rideable Type** <a class=\"anchor\"  id=\"subsection6_6\"></a>\n","We will focus now on analysing the type of services our user types prefer. We have 3 types of rideable bikes on our data base:\n","- Classic bike\n","- Docked bike\n","- Electric bike\n","\n","Let's see how the usage of these bikes is distributed by user type and other parameters!"]},{"cell_type":"code","execution_count":27,"id":"19a135c6","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:44:26.938154Z","iopub.status.busy":"2024-01-25T13:44:26.93601Z","iopub.status.idle":"2024-01-25T13:44:33.564016Z","shell.execute_reply":"2024-01-25T13:44:33.561878Z"},"papermill":{"duration":6.668102,"end_time":"2024-01-25T13:44:33.566948","exception":false,"start_time":"2024-01-25T13:44:26.898846","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'usertype'. You can override using the\n","`.groups` argument.\n","\u001b[1m\u001b[22m`summarise()` has grouped output by 'usertype', 'rideable_type'. You can\n","override using the