EwQ4AAEASBDsAAABJEOwA\nAAAkQbADAACQBMEOAABAEgQ7AAAASRDsAAAAJEGwAwAAkATBDgAAQBIEOwAAAEkQ7AAAACRB\nsAMAAJAEwQ4AAEASBDsAAABJEOwAAAAkQbADAACQBMEOAABAEgQ7AAAASRDsAAAAJEGwAwAA\nkATBDgAAQBIEOwAAAEkQ7AAAACRBsAMAAJAEwQ4AAEASBDsAAABJEOwAAAAkQbADAACQBMEO\nAABAEgQ7AAAASRDsAAAAJEGwAwAAkATBDgAAQBL/DzjVNJx3WF6wAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Create subset of data\n","rideable_user <- total_trips_v2 %>% \n","  group_by(usertype, rideable_type) %>% \n","  summarise(number_of_trips = n(),\n","            average_duration = mean(duration_seconds))%>%\n","  mutate(percentage = round(number_of_trips / sum(number_of_trips) * 100))\n","\n","view(rideable_user)\n","\n","# Check rideable types totals per user type\n","rideable_user %>%\n","  ggplot(aes(x = usertype, y = number_of_trips, fill = rideable_type)) +\n","  geom_col(position = \"stack\") + \n","  labs(title = \"Rides per Rideable Type by User type\",\n","       x = \"User type\",\n","       y = \"Number of rides\",\n","       fill = \"Rideable type\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") + \n","  theme_minimal()\n","\n","# Per month\n","rideable_user_month <- total_trips_v2 %>% \n","  group_by(usertype, rideable_type, month) %>% \n","  summarise(number_of_trips = n(),\n","            average_duration = mean(duration_seconds))\n","\n","rideable_user_month %>%\n","  ggplot(aes(x = month(month, label=TRUE), y = number_of_trips, fill = rideable_type)) +\n","  geom_col(position = \"dodge\") + \n","  labs(title = \"Rides per Rideable Type per Usertype by Month\",\n","       x = \"\",\n","       y = \"Number of rides\",\n","       fill = \"Rideable type\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n","  theme_minimal() + \n","  facet_wrap(~ usertype)\n","\n","# Per weekday\n","rideable_user_weekday <- total_trips_v2 %>% \n","  group_by(usertype, rideable_type, weekday) %>% \n","  summarise(number_of_trips = n(),\n","            average_duration = mean(duration_seconds))\n","\n","rideable_user_weekday %>%\n","  ggplot(aes(x = weekday, y = number_of_trips, fill = rideable_type)) +\n","  geom_col(position = \"stack\") + \n","  labs(title = \"Rides per Rideable Type per Usertype by Weekday\",\n","       x = \"\",\n","       y = \"Number of rides\",\n","       fill = \"Rideable type\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n","  theme_minimal() + \n","  facet_wrap(~ usertype)"]},{"cell_type":"markdown","id":"a7ebfb6a","metadata":{"papermill":{"duration":0.037861,"end_time":"2024-01-25T13:44:33.643419","exception":false,"start_time":"2024-01-25T13:44:33.605558","status":"completed"},"tags":[]},"source":["#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n","- What first strikes out is the usage of **docked bikes only by casual users**, except from **one member ride**. There should be more investigation on what is the difference between classic bikes and docked bikes to really draw any conclusion regarding this point.\n","- There is a **similiar number of rides of classic and electric bikes** by both user types (47% of rides for casual riders and 45% for members). \n","- To get a more accurate picture of usage habits, we would need to get the s**tock number of classic and electric bikes**. If there is a big difference of the number of bikes, for instance many more classic bikes than electric, we could safely conclude that, although the number of electric bikes rides is smaller, clients tend to prefer this rideable type.\n","\n","## 7. Most Used **Stations** <a class=\"anchor\"  id=\"subsection6_7\"></a>\n","The data for performing this analysis has some limitations. We have some NA's or empty values for data regarding the information about stations names, ids, latitude and longitude, as we have already seen during the cleaning step. Now it is time to get ride of these NA values!\n","> <div class=\"alert alert-block alert-warning\">\n","    While working with this data, I checked if it was possible to infer the names of the stations by their IDs, or vice versa, but I could only use these procedure for 2 IDs, so I will just proceed to clean the data without taking this approach.\n","    Other aspect to take into account is that <b>I don't want this cleaning step to affect the representativeness of my data</b>. This will be handled in the code below.\n","   </div>"]},{"cell_type":"code","execution_count":28,"id":"98633ea9","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:44:33.723515Z","iopub.status.busy":"2024-01-25T13:44:33.72157Z","iopub.status.idle":"2024-01-25T13:45:39.873298Z","shell.execute_reply":"2024-01-25T13:45:39.871148Z"},"papermill":{"duration":66.19596,"end_time":"2024-01-25T13:45:39.877311","exception":false,"start_time":"2024-01-25T13:44:33.681351","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".dl-inline {width: auto; margin:0; padding: 0}\n",".dl-inline>dt, .dl-inline>dd {float: none; width: auto; display: inline-block}\n",".dl-inline>dt::after {content: \":\\0020\"; padding-right: .5ex}\n",".dl-inline>dt:not(:first-of-type) {padding-left: .5ex}\n","</style><dl class=dl-inline><dt>ride_id</dt><dd>0</dd><dt>rideable_type</dt><dd>0</dd><dt>started_at</dt><dd>0</dd><dt>ended_at</dt><dd>0</dd><dt>start_station_name</dt><dd>0</dd><dt>start_station_id</dt><dd>0</dd><dt>end_station_name</dt><dd>0</dd><dt>end_station_id</dt><dd>0</dd><dt>start_lat</dt><dd>0</dd><dt>start_lng</dt><dd>0</dd><dt>end_lat</dt><dd>116</dd><dt>end_lng</dt><dd>116</dd><dt>usertype</dt><dd>0</dd><dt>duration_seconds</dt><dd>0</dd><dt>year</dt><dd>0</dd><dt>month</dt><dd>0</dd><dt>weekday</dt><dd>0</dd><dt>hour</dt><dd>0</dd></dl>\n"],"text/latex":["\\begin{description*}\n","\\item[ride\\textback