lOxQIAAEiCYAcAACAJgh0AAIAkCHYAAACSINgBAABIgmAHAAAgCYIdAACAJAh2AAAAkiDY\nAQAASIJgBwAAIAmCHQAAgCQIdgAAAJIg2AEAAEiCYAcAACAJgh0AAIAkCHYAAACSINgBAABI\ngmAHAAAgCYIdAACAJAh2AAAAkiDYAQAASIJgBwAAIAmCHQAAgCQIdgAAAJIg2AEAAEiCYAcA\nACAJgh0AAIAkCHYAAACSINgBAABIgmAHAAAgCYIdAACAJAh2AAAAkvg/hkUBPzoyIc8AAAAA\nSUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Subset of dataset with the trips for Streeter Dr & Grand Ave station grouped by usertype, weekday and hour\n","station_hour <- total_trips_v2 %>%\n","  filter(start_station_name == \"Streeter Dr & Grand Ave\") %>% \n","  mutate(day_category = ifelse(weekday %in% c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\"), \"Weekday\", \"Weekend\"),\n","         date_only = as.Date(started_at)) %>%\n","  group_by(date_only, usertype, hour, day_category) %>% # Group by user type and hour\n","  summarise(number_of_rides = n(),\n","            average_duration = mean(duration_seconds),\n","            max_duration = max(duration_seconds)) %>%\n","  group_by(usertype, hour, day_category) %>% \n","  summarise(average_rides_per_hour = mean(number_of_rides)) %>% \n","  group_by(usertype, hour, day_category) %>% \n","  summarise(average_rides_per_hour_per_user = mean(average_rides_per_hour))\n","# Visualize results\n","station_hour %>%\n","  ggplot(aes(x = hour, y = average_rides_per_hour_per_user, color = usertype)) +\n","  geom_line() + \n","  labs(title = \"Number of Rides per Usertype by Hour at Streeter Dr & Grand Ave\",\n","       x = \"Hours\",\n","       y = \"\",\n","       color = \"Usertype\",\n","       subtitle = \"January 2021 - November 2023\") +\n","  scale_color_brewer(palette = \"Set2\", direction = 1) +  \n","  theme_minimal() +\n","  facet_wrap(~ day_category, scales = \"free_x\")\n","\n","# Create a subset table with trips on chosen station grouped by usertype and month\n","station_month <- total_trips_v2 %>% \n","  filter(start_station_name == \"Streeter Dr & Grand Ave\") %>%\n","  group_by(usertype, month) %>%\n","  summarise(number_of_rides = n()) %>% \n","  arrange(month)\n","# Visualize results\n","station_month %>%\n","  ggplot(aes(x = month(month, label = TRUE, abbr = TRUE), y = number_of_rides, fill = usertype)) +\n","  geom_col(position = \"dodge\") + \n","  labs(title = \"Number of Rides per Usertype by Month at Streeter Dr & Grand Ave\",\n","        x = \"\",\n","        y = \"Number of Rides\",\n","        fill = \"Usertype\",\n","        subtitle = \"January 2021 - November 2023\") +\n","  scale_fill_brewer(palette = \"Set2\") + \n","  theme_minimal() +\n","  theme(\n","    axis.text = element_text(size = 10, color = \"black\"),\n","    axis.title = element_text(size = 12, color = \"black\"),\n","    legend.title = element_text(size = 12, color = \"black\"),\n","    legend.text = element_text(size = 10, color = \"black\"),\n","    plot.title = element_text(size = 14, color = \"black\")\n","  )\n","\n"]},{"cell_type":"markdown","id":"4794bbd6","metadata":{"papermill":{"duration":0.044754,"end_time":"2024-01-25T13:45:48.75222","exception":false,"start_time":"2024-01-25T13:45:48.707466","status":"completed"},"tags":[]},"source":["This means it might be useful to focus campaigns on getting new member users around **Streeter Dr & Grand Ave** station at **weekends** on the **summertime**.\n","\n","### Geographical Visualizations\n","\n","For the sake of practice and clarification, we will  also perform an analysis including the different neighborhoods of the Chicago city and the trips started on each of them. But for this purpose, we need the **data for the localization of these neighborhoods**, as downloaded from the [Chicago Data Portal](https://data.cityofchicago.org/Facilities-Geographic-Boundaries/Boundaries-Neighborhoods/bbvz-uum9). \n","\n","We will first load the libraries necessary for the graphical representation and then, load the data that we have previously upload to our Cyclistic Database."]},{"cell_type":"code","execution_count":31,"id":"f01c499f","metadata":{"execution":{"iopub.execute_input":"2024-01-25T13:45:48.845824Z","iopub.status.busy":"2024-01-25T13:45:48.844054Z","iopub.status.idle":"2024-01-25T13:46:12.601472Z","shell.execute_reply":"2024-01-25T13:46:12.599462Z"},"papermill":{"duration":23.807768,"end_time":"2024-01-25T13:46:12.604677","exception":false,"start_time":"2024-01-25T13:45:48.796909","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Linking to GEOS 3.8.0, GDAL 3.0.4, PROJ 6.3.1; sf_use_s2() is TRUE\n","\n","Support for Spatial objects (`sp`) will be deprecated in {rnaturalearth} and will be removed in a future release of the package. Please use `sf` objects with {rnaturalearth}. For example: `ne_download(returnclass = 'sf')`\n","\n","\n","Attaching package: ‚Äòrnaturalearthdata‚Äô\n","\n","\n","The following object is masked from ‚Äòpackage:rnaturalearth‚Äô:\n","\n","    countries110\n","\n","\n"]},{"name":"stdout","output_type":"stream","text":["Reading layer `Boundaries - Community Areas (current)' from data source \n","  `/kaggle/input/cyclistic-data/Boundaries - Community Areas (current).geojson' \n","  using driver `GeoJSON'\n","Simple feature collection with 77 features and 9 fields\n","Geometry type: MULTIPOLYGON\n","Dimension:     XY\n","Bounding box:  xmin: -87.94011 ymin: 41.64454 xmax: -87.52414 ymax: 42.02304\n","Geodetic CRS:  WGS 84\n"]}],"source":["# Import packages and load libraries for map representation\n","library(ggplot2)\n","library(sf)\n","library(rnaturalearth) # Provides a map of countries of the entire world\n","library(rnaturalearthdata) # Provides the data of map of countries of the entire world\n","library(ggrepel)\n","\n","# Read data for map of Chicago neighborhoods\n","chicago_neighborhoods <-  st_read('../input/cyclistic-data/Boundaries - Community Areas (current).geojson')\n","\n","# Map for whole world in sf format\n","world <- ne_countries(scale = \"medium\", returnclass 