hood <- joined_data %>% \n","  group_by(community, usertype)%>% \n","  summarise(number_rides = sum(number_rides),\n","            geometry=first(geometry),\n","            area=first(area),\n","            shape_area=first(shape_area),\n","            perimeter=first(perimeter),\n","            area_num_1=first(area_num_1),\n","            area_numbe=first(area_numbe),\n","            comarea_id=first(comarea_id),\n","            comarea=first(comarea),\n","            shape_len=first(shape_len))\n","\n","# Top5 neighborhoods for members\n","top5_neighborhood_member <- rides_neighborhood %>% \n","  filter(usertype == \"member\") %>% \n","  arrange(desc(number_rides)) %>% \n","  head(n=5)\n","top5_neighborhood_member <- cbind(top5_neighborhood_member, st_coordinates(st_centroid(top5_neighborhood_member)))\n","\n","# Top5 neighborhoods for casual riders\n","top5_neighborhood_casual <- rides_neighborhood %>% \n","  filter(usertype == \"casual\") %>% \n","  arrange(desc(number_rides)) %>% \n","  head(n=5)\n","top5_neighborhood_casual <- cbind(top5_neighborhood_casual, st_coordinates(st_centroid(top5_neighborhood_casual)))\n","head(top5_neighborhood_casual)\n","\n","# Most used stations member\n","top5_stations_member <-start_points_by_station %>% \n","  filter(usertype == \"member\") %>% \n","  arrange(desc(number_rides)) %>% \n","  head(n=5)\n","head(top5_stations_member)\n","top5_stations_member <- cbind(top5_stations_member, st_coordinates(st_centroid(top5_stations_member)))\n","\n","# Most used stations casual\n","top5_stations_casual <-start_points_by_station %>% \n","  filter(usertype == \"casual\") %>% \n","  arrange(desc(number_rides)) %>% \n","  head(n=5)\n","top5_stations_casual <- cbind(top5_stations_casual, st_coordinates(st_centroid(top5_stations_casual)))"]},{"cell_type":"markdown","id":"53e5944f","metadata":{"papermill":{"duration":0.114861,"end_time":"2024-01-25T13:47:01.498658","exception":false,"start_time":"2024-01-25T13:47:01.383797","status":"compl