, \n","             aes(X, Y, label = community), \n","             size = 2, \n","             fontface = \"bold\", \n","             nudge_y = top5_neighborhood_member$nudge_y) +\n","  coord_sf(xlim = c(-87.73, -87.57), ylim = c(41.85, 41.97), expand = TRUE)+\n","  xlab(\"Longitude\") + ylab(\"Latitude\") +\n","  ggtitle(\"Top 5 Districts - MEMBERS\")\n","\n","#Top5 neighborhoods CASUAL\n","ggplot(data = world) +\n","  geom_sf() +\n","  geom_sf(data=neighborhoods, fill = NA) +\n","  geom_sf(data = top5_neighborhood_casual, aes(fill = number_rides)) + \n","  geom_label(data = top5_neighborhood_casual, \n","             aes(X, Y, label = community), \n","             size = 2, \n","             fontface = \"bold\", \n","             nudge_y = top5_neighborhood_casual$nudge_y) +\n","  coord_sf(xlim = c(-87.73, -87.57), ylim = c(41.85, 41.97), expand = TRUE) +\n","  xlab(\"Longitude\") + ylab(\"Latitude\") +\n","  ggtitle(\"Top 5 Districts - CASUAL RIDERS\")\n","\n","# Top stations MEMBER\n","ggplot(data = world) +\n","  geom_sf() +\n","  geom_sf(data=neighborhoods, fill = NA) +\n","  geom_sf(data = top5_stations_member, size = 4, aes(color = number_rides)) + \n","  geom_label(data = top5_neighborhood_casual, \n","             aes(X, Y, label = community), \n","             size = 2) +\n","  geom_text_repel(data = top5_stations_member, \n","                  aes(X, Y, label = start_station_name),\n","                  nudge_x = top5_stations_member$nudge_x,\n","                  nudge_y = top5_stations_member$nudge_y) +\n","  \n","  coord_sf(xlim = c(-87.67, -87.60), ylim = c(41.87, 41.93), expand = TRUE) +\n","  xlab(\"Longitude\") + ylab(\"Latitude\") +\n","  ggtitle(\"Top 5 Stations - MEMBERS\")\n","\n","# Top stations CASUAL\n","ggplot(data = world) +\n","  geom_sf() +\n","  geom_sf(data=neighborhoods, fill = NA) +\n","  geom_sf(data = top5_stations_casual, size = 4, aes(color = number_rides)) + \n","  geom_label(data = top5_neighborhood_casual, \n","             aes(X, Y, label = community), \n","             size = 2) +\n","  geom_text_repel(data = top5_stations_casual, \n","                  aes(X, Y, label = start_station_name),\n","                  nudge_x = top5_stations_casual$nudge_x,\n","                  nudge_y = top5_stations_casual$nudge_y) +\n","  coord_sf(xlim = c(-87.65, -87.60), ylim = c(41.86, 41.91), expand = TRUE) +\n","  xlab(\"Longitude\") + ylab(\"Latitude\") +\n","  ggtitle(\"Top 5 Stations - CASUAL RIDERS\")"]},{"cell_type":"markdown","id":"252e9d20","metadata":{"papermill":{"duration":0.123128,"end_time":"2024-01-25T13:47:07.691157","exception":false,"start_time":"2024-01-25T13:47:07.568029","status":"completed"},"tags":[]},"source":["#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n","\n","This results show us that both annual members and casual riders start their rides in the **central neighborhoods** of Chicago, being the stations within the **Near North Side** the most demanded ones. Casual riders have a remarkable preference for starting their rides at **Streeter Dr & Grand Ave**, while the usage of top preferred stations for members is more homegeneous. Of note, some of the top used stations for casual riders might imply a leisure usage of Cyclistic, such as **Shed Aquarium**. \n","\n","> <div class=\"alert alert-block alert-warning\">\n","    In spite of these results, we should <b> critically consider and evaluate the previous conclusions </b>. During the cleaning process, we have remove a considerable ammount of data that contained NA values or empty strings, so this analysis might not be representative. We should discuss this point with our team and also figure out why there is so much data missing regarding the starting and ending stations.\n","   </div>"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":4255670,"sourceId":7463908,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":1373.681806,"end_time":"2024-01-25T13:47:09.551138","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-01-25T13:24:15.869332","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}